import React, { Component } from 'react'

export default class App extends Component {
  constructor(props){
    super(props)
    this.state ={
      username:"dien",
      nextPlayer:"O"
    }
  }
  render() {

    return (
      <div>
        <h1>Tic Tac Toe</h1>
        <h3>User name : {this.state.username}</h3>
        <h4> nextPlayer:{this.state.nextPlayer}</h4>
      </div>
    )
  }
}
